import React from 'react';
import MandalArtTable from './MandalArtTable';

const MandalArtTemplate = (table) => {
    return (
        <main>
            <title>만다라트</title>

            <table>
                <tr>
                    {table}
                </tr>
            </table>
        </main>
    );
};

export default MandalArtTemplate;
